import React from 'react';

function PopupImage(props) {
  return (
    <div className={`popup popup_type_${props.name} ${props.isOpen && "popup_state_show"}`}>
    <div className="popup__container  popup__container_type_image">
      <img className="popup__image" src="" alt="иллюстрация"/>
      <p className="popup__caption">{ }</p>
      <button className="popup__close-button" type="button" aria-label="кнопка закрыть" onClick={ props.onClose }></button>
    </div>
  </div>
  );
}

export default PopupImage;
